import React from 'react';
import {Link} from 'react-router-dom';
const Navbar=()=>{
    return (
        <>
            <Link to='/' style={{color:'blue',textDecoration:'none',fontSize:'24px'}}>About Us</Link>
            &nbsp;&nbsp;&nbsp;
            <Link to='/contact' style={{color:'blue',textDecoration:'none',fontSize:'24px'}}>Contact Us</Link>
            {/* <br/>
            <a href="/" style={{color:'blue',textDecoration:'none',fontSize:'24px'}}>About Us</a>
            &nbsp;&nbsp;&nbsp;
            <a href="/contact" style={{color:'blue',textDecoration:'none',fontSize:'24px'}}>Contact Us</a> */}
        </>
    );
};
export default Navbar;
